import { useState } from 'react';
import TaskItem from './TaskItem';

import './TaskList.css';

const TaskList = (props) => {
    const toDoList = [{tasktitle:"Pramod", taskDaysLeft:"7"}, ...props.allTasks];
    return (
        <div>
            {
                toDoList.map( e => <TaskItem title={e.tasktitle} daysLeft={e.taskDaysLeft} /> )
            }
        </div>
    ); 
}

export default TaskList;
